import React from 'react';
import WidgetBar from './widgets/WidgetBar';

const Products = () => {
		return (
			<div className="content-wrapper">
				<div className="container">
					<div className="row">
						<div className="col-md-3">
							<WidgetBar />
						</div>
						<div className="col-md-9">
							
						</div>
					</div>
				</div>
			</div>
		);
};

export default Products;
